// pages/detial/detail.js

var wxCharts = require('../../utils/wxcharts.js');
var app = getApp();
Page({

    /**
     * 页面的初始数据
     */
    data: {
        // 图片的路径
        src: '',

        id: '',
        age: '',
        face_value: '',
        emotion: '',
        stain: '',
        acne: '',
        dark_circle: '',
        /** floating-button data :start */
        buttons: [{
                label: '表扬下',
                icon: "data:image/png;base64,",
            },
            {
                label: '吐槽下',
                icon: 'data:image/png;base64,'
            }
        ],
        position: 'bottomRight',
        visible: false,
        /** floating-button data :end */
    },



    /**
     * 生命周期函数--监听页面加载
     */
    onLoad: function(options) {
        this.setData({
            id: options.id,
            age: options.age,
            faceValue: options.faceValue,
            src: options.src,
        });
        var that = this;
        var geturl = app.globalData.url + '/faceInfo/get'
        wx.request({
            url: geturl,
            data: {
                id: that.data.id,
            },
            header: {
                'content-type': 'json',
                'token': wx.getStorageSync("token"),
                'role': wx.getStorageSync("role")
            },
            success: function(res) {
                console.log(res.data.info)
                that.setData({
                    face_value: res.data.info.faceValue,
                    age: res.data.info.age,
                    emotion: res.data.info.emotion,
                    stain: res.data.info.skinStatus.stain,
                    acne: res.data.info.skinStatus.acne,
                    dark_circle: res.data.info.skinStatus.dark_circle,
                });
            }
        });
        var windowWidth = 320;
        try {
            var res = wx.getSystemInfoSync();
            windowWidth = res.windowWidth;
        } catch (e) {
            console.error('getSystemInfoSync failed!');
        }
        new wxCharts({
            canvasId: 'radarCanvas',
            type: 'radar',
            categories: ['1', '2', '3', '4', '5', '6'],
            series: [{
                name: '成交量1',
                data: [90, 110, 125, 95, 87, 122]
            }],
            width: windowWidth,
            height: 200,
            extra: {
                radar: {
                    max: 150
                }
            }
        });
    },


    buttonClicked(e) {
        const {index} = e.detail
        var that = this;
        var clickurl = app.globalData.url;

        // 表扬
        index === 0 && wx.request({
            url: clickurl + '/comment/like',
            data: {
                photoId: that.data.id,
                satisfied: 1
            },
            header: {
                'content-type': 'json',
                'token': wx.getStorageSync("token"),
                'role': wx.getStorageSync("role")
            },
            success: function (res) {
                wx.showModal({
                    title: '表扬成功',
                    showCancel: !1,
                });
            }
        });

        // 吐槽
        index === 1 && wx.request({
            url: clickurl + '/comment/like',
            data: {
                photoId: that.data.id,
                satisfied: 0
            },
            header: {
                'content-type': 'json',
                'token': wx.getStorageSync("token"),
                'role': wx.getStorageSync("role")
            },
            success: function (res) {
                wx.showModal({
                    title: '吐槽成功',
                    showCancel: !1,
                })
            }
        });
    },
    bindchange(e) {
    
    },

    /**
     * 用户点击右上角分享
     */
    onShareAppMessage: function() {

    },
})